webpackJsonp([27865889365826],{1483:function(a,e){a.exports={data:{markdownRemark:{html:'<p>早朝、私はウォレスの2つの小説、博士盛盛とバンシー島を読んだ。彼は人気のある小説の作家であり、平均流通量は約400万部である。それは時代遅れですが、それはまだ暑いです。これらの2冊の本の話は全く斬新ですが、その意味は深刻ではなく、一般の読書を払拭するために書かれています。もちろん、主題は新規である。前の本は人々の性生活の概念を書いた。米国の有名な「ゴールデン・セクシュアリティ・レポート」によれば、リサーチ・ストーリーは変わり、そのプロットも同時に（1960年代）であった。今日は普通のことです。 「バンシー島」は、現代文明の人々が原始文明の状況に遭遇し、文明の概念が衝突したという意味のビットである。事実上の根拠があるかもしれませんが、まだ架空です。現代文明は、ここでは異なる種類の文明と価値観に遭遇します。この原始文明は人間の本質に沿ったものであると感じているようです。実際には、彼が書いた、あるいは期待している価値の多くは、今日の西洋の世界に登場しました。原始的な人々には、単純な生活様式があります。現代人の中には、性的解放や性的混乱があります。これは文明の価格です。</p>\n<p>このトピックは長い間人々を混乱させてきましたが、元来の人生と現代人の生活はどちらかというと人間性に似ていますか？ローマのクラブと未来の学校の議論は今日ではありませんか？それはここにありますか？人々はまだ苦労しなければならないようです。</p>\n<p>朝食後に散歩をして、業界を説得するために西大（Xidan）まで歩きます。それに行くとそれを調べ、小さな場所、多くの屋台、おそらくすべてのレンタル、主に服。出入口には、 "上海の靴38元ペア"と言って、大きなブランドでそれにぶら下がっていくつかの屋台があります。上海の革靴ではないかもしれないし、上海のブランドは産業の力を意味する。上海はそれ自体のブランドをうまく利用していませんでしたが、他の人はそれを大いに活用しました。そして、彼らは祝福に祝福されません。市場全体は、ジーンズ、シャツ、ショートパンツ、ベルト、財布によって支配されています。かなりの色があり、多くの国際的なファッションスタイルがあります。私たちはまもなく登場し、非常に素早く模倣しています。ストールオーナーのほとんどは地元の人ではありません。</p>',id:"/home/swain/workspace/political-life/src/pages/ja/0134.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ja/0134.md",frontmatter:{title:"8月14日 日曜日"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ja/0134.md absPath of file >>> MarkdownRemark"}}}});
